<div class="entities" style="line-height: 2.5; direction: ltr">Synthesis and biological evaluation of novel oxindole-based RTK inhibitors as anti-cancer agents . Given that receptor tyrosine kinases ( RTKs ) have emerged as key regulators of all aspects of cancer development , including proliferation , invasion , angiogenesis and metastasis , the RTK family represents an important therapeutic target for anti-cancer drug development . Oxindole structure has been used in RTK inhibitors such as

</mark>
 and intedanib . In this study , two series of new heterocyclic compounds containing oxindole scaffold have been designed and synthesized , and their inhibitory activity against the proliferation of nine cancer cell lines has been evaluated . Among them , compounds 9a and 9b displayed the strongest anti-proliferative activity with the IC50s below 10μM . Flow cytometric analysis showed that the compounds 9a and 9b dose-dependently arrested the cell cycle at G0 / P55008 phase . Although the leading compounds

 and intedanib targets

 , the kinase activity test revealed that these compounds only showed slight inhibitory activity on

<div class="entities" style="line-height: 2.5; direction: ltr">A novel multiple tyrosine-kinase targeted agent to explore the future perspectives of anti-angiogenic therapy for the treatment of multiple solid tumors : cabozantinib . The process of angiogenesis involves the formation of new blood vessels from pre-existing vasculature by the over expression of certain factors leading to the growth and development of all solid tumor types . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 abbreviated as c - DB00134 and vascular endothelial growth factor abbreviated as 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 are some of the factors responsible for the induction in tumor growth and development . Recently a number of analogues associated with these receptors are under study . US FDA on November 29 , 2012 approved a drug named cabozantinib formerly known as 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05153
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 which is being marketed under the trade name of Cometriq for the treatment of Medullary Thyroid Cancer ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04629
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . Designing of the drug has been done in such a fashion that it can inhibit both 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 and c - DB00134 simultaneously without over expressing any of the factors leading to the inhibition of angiogenesis . The drug is still under study for the evaluation of its efficacy in cases of many other solid tumor types including breast cancer , castration resistant prostate cancer ( CRPC ) , renal cell carcinoma ( RCC ) , hepatocellular carcinoma ( HCC ) , gastric or gastroesophageal junction cancer , melanoma , small cell lung cancer ( SCLC ) , ovarian cancer and primary peritoneal or fallopian tube carcinoma . This review article consists of preclinical and clinical data of cabozantinib and its efficacy and safety towards various types of solid tumors .</div>

 T cell responses in blood and bronchoalveolar lavage . In contrast , aerosolized AERAS - 402 alone or following BCG induced potent and stable Ag85A / b-specific
